import React from 'react';
import '../../App.css';
import Navbar from '../layout/Navbar';
const Home = () => {
  return (
    <div>
      <Navbar />
      <div className="container-fluid">
        <div className="py-4" >
          <div className='row'>
            <img class="d-block w-100" src="/images/project images/05-1-1536x512.webp" alt="First slide" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;

